Family

A short film shot across cities within the nation...featuring my colleagues from the Indian film industry...each one of us putting our individual pieces together from the safety of our respective homes. All this with ONE aim and ONE simple message... #StayHomeStaySafe.

This film which transcends the borders of region and language, was also created to raise funds for our extended family, who are the backbone of the entertainment industry...the technicians and assistants who work on a daily wage. This is for them.

Thank you @amitabhbachchan for bringing us together (virtually and with #SocialDistancing in place) and making this happen. We are one and we shall overcome!

